import React from "react";
import { Jumbotron, Form, Button } from "react-bootstrap";
import DropdownMultiselect from "react-multiselect-dropdown-bootstrap";
export const AddTicketForm = (
  handleOnChange,
  handleOnSubmit,
  handleOnSelectedChange
) => {
  return (
    <Jumbotron>
      <Form autoComplete="off" onSubmit={handleOnSubmit}>
        <Form.Group>
          <Form.Label>Sujet</Form.Label>
          <Form.Control
            type="subject"
            name="subject"
            onChange={handleOnChange}
            //value={email}
            placeholder="Entrez votre addresse email"
            required
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Date de reclamation</Form.Label>
          <Form.Control
            type="date"
            name="IssueDate"
            onChange={handleOnChange}
            //value={pass}
            placeholder="Mot de passe"
            required
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Les details</Form.Label>
          <Form.Control
            as="textarea"
            //type="date"
            name="details"
            onChange={handleOnChange}
            //value={pass}
            placeholder="Mot de passe"
            required
          />
        </Form.Group>

        <Form.Group>
          <Form.Label>Priorit√©</Form.Label>
          <DropdownMultiselect
            options={["Eleve", "Moyen", "Bas"]}
            name="priority"
            onChange={handleOnSelectedChange}
            required
          />
          ;
        </Form.Group>
        <Button type="submit" variant="info">
          Envoyer
        </Button>
      </Form>
    </Jumbotron>
  );
};
